from django.db import modelsfrom apps.account.models import Accountfrom apps.warehouse.models import ItemsModelclass ExpenseModel(models.Model):    receiver = models.ForeignKey(Account, on_delete=models.SET_NULL, null=True, related_name="expenses")class ExpenseItemsModel(models.Model):    item = models.ForeignKey(ItemsModel, on_delete=models.CASCADE)    expense = models.ForeignKey(ExpenseModel, on_delete=models.CASCADE)